import React, { useState } from 'react'

const Task = () => {
  const [tasks, setTasks] = useState([
    {id:1, task:"laundry", status:true},
    {id:2, task:"reading", status:false},
    {id:3, task:"bathing", status:true},
    {id:4, task:"ovie", status:false}
  ])
  return (
    <div>Task Lists</div>
  )
}

export default Task
